import framing from "../../assets/json-files/framing";
import './list-box-styles.scss'

const clickHandler = ({item}) => {
    return alert(`${item.Framing}`)

}

const ListBox = () =>{
    return(
        <div>
            <h1>List Component</h1>
            <div className="list-container">
                {framing.map((items) =>
                    <h2 onClick={clickHandler(items)}key={items.id}>{items.Framing}</h2>
                )}
            </div>
        </div>
    )
}

export default ListBox;
